import React, {Component} from 'react';
import logo from './logo.svg';
import Navbar from './Components/Navbar/Navbar';
import './App.css';





class App extends Component {
  constructor(){
    super();
    this.state = {
      isSignedIn: false,
      route: 'signIn',
      title: '',
      user:{
        id: '',
        firstname: '',
        lastname: '',
        email: '',
        colour: '',
        isadmin: false
      }
    }
  }


  render(){
     const {title} = this.state;
     return (
        <div className="App">
          <Navbar/> 
            <h1>{title}</h1>

        </div>
      );
  }

}

export default App;
